import React, { useState } from 'react';
import axios from 'axios';
import './EditInfo.css';

const EditInfo = () => {
    const [formData, setFormData] = useState({
        lastName: '',
        firstName: '',
        personalEmail: '',
        section: '',
        adviser: '',
        acadYear: '',
        sem: '',
    });

    const handleInputChange = (e) => {
        const { id, value } = e.target;
        setFormData({ ...formData, [id]: value });
    };

    const handleSubmit = async () => {
        try {
            const response = await axios.post('http://localhost:8080/updateStudentDetails', formData);
            alert(response.data.message);
        } catch (error) {
            console.error(error);
            alert('An error occurred while updating information.');
        }
    };

    return (
        <div className="editinfo-body">
            <div className="editinfo-container">
                <div className="editinfo-rectangle">
                    <div className="editinfo-header">
                        <h3>EDIT INFORMATION</h3>
                    </div>
                    <div className="form">
                        <div className="column">
                            <div className="input-box">
                                <label htmlFor="lastName">Last Name</label>
                                <input id="lastName" value={formData.lastName} onChange={handleInputChange} placeholder="Enter last name" />
                            </div>
                            <div className="input-box">
                                <label htmlFor="firstName">First Name</label>
                                <input id="firstName" value={formData.firstName} onChange={handleInputChange} placeholder="Enter first name" />
                            </div>
                        </div>
                        <div className="input-box">
                            <label htmlFor="personalEmail">Personal Email</label>
                            <input id="personalEmail" value={formData.personalEmail} onChange={handleInputChange} placeholder="Enter personal email" />
                        </div>
                        <div className="column">
                            <div className="input-box">
                                <label htmlFor="section">Section</label>
                                <input id="section" value={formData.section} onChange={handleInputChange} placeholder="Choose section" />
                            </div>
                            <div className="input-box">
                                <label htmlFor="adviser">Adviser</label>
                                <input id="adviser" value={formData.adviser} onChange={handleInputChange} placeholder="Choose adviser" />
                            </div>
                        </div>
                        <div className="column">
                            <div className="input-box">
                                <label htmlFor="acadYear">Academic Year</label>
                                <input id="acadYear" value={formData.acadYear} onChange={handleInputChange} placeholder="Academic Year" />
                            </div>
                            <div className="input-box">
                                <label htmlFor="sem">Semester</label>
                                <input id="sem" value={formData.sem} onChange={handleInputChange} placeholder="Semester" />
                            </div>
                        </div>
                        <div className="edit-container">
                            <button className="editinfo-edit-button" onClick={handleSubmit}>Edit</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default EditInfo;
